  \"input-digital-datasets-for-the-soil-water-balance-groundwater-recharge-model-of-the-upper-color\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Colorado River and its tributaries
  supply water to more than 35 million people in the United States and 3 million people
  in Mexico, irrigating more than 4.5 million acres of farmland, and generating about
  12 billion kilowatt hours of hydroelectric power annually. Planning for the sustainable
  management of the Colorado River in future climates requires an understanding of
  the Upper Colorado River Basin groundwater system. The Upper Colorado River Basin,
  encompassing more than 110,000 square miles (mi2), contains the headwaters of the
  Colorado River and is an important source of snowmelt runoff to the River. Groundwater
  discharge also is an important source of water in the River and its tributaries,
  with estimates ranging from 21 to 58 percent of streamflow in the upper basin. A
  study by Castle and others (2014) using remotely sensed gravity observations from
  the NASA Gravity Recovery and Climate Experiment (GRACE) mission found that UCRB
  groundwater was depleted by more than 17 million acre-feet (ft) from December 2004
  to November 2013. Understanding groundwater-budget components, including groundwater
  recharge, is important to sustainably manage both groundwater and surface-water
  supplies in the Colorado River Basin.\",\n\t\"license_title\": null,\n\t\"extras\":
